import React, { useState, useEffect, Fragment } from 'react';
import axios from 'axios';
import { Link } from 'react-router-dom';
import Navbar from "../components/navbar";
import notiIcon from '../images/icons8-notifications-64.png';
import settingsIcon from '../images/icons8-settings-50.png';
import menuIcon from '../images/icons8-menu-50.png';
import ReactFlow, { addEdge, Background, Controls, MiniMap, ReactFlowProvider, removeElements, useStoreActions } from 'react-flow-renderer';
import './buildChatflow.css';
import { API_ROUTES } from '../app-modules/api_routes';

const initialElements = [
  { id: '1', type: 'input', data: { label: 'Hi' }, position: { x: 250, y: 5 } },
  { id: '2', data: { label: 'Reply: Hi, how can I help you?' }, position: { x: 100, y: 100 } },
  { id: '3', data: { label: 'Bye' }, position: { x: 400, y: 100 } },
  { id: 'e1-2', source: '1', target: '2', animated: true },
  { id: 'e1-3', source: '1', target: '3', animated: true },
];

const BuildChatFlow = () => {
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  const [apps, setApps] = useState([]);
  const [error, setError] = useState('');
  const [elements, setElements] = useState(initialElements);
  const [nodeName, setNodeName] = useState('');
  const [nodePosition, setNodePosition] = useState({ x: 250, y: 250 });

  const toggleMenu = () => {
      setIsMenuOpen(!isMenuOpen);
  };

  useEffect(() => {
    const fetchApps = async () => {
      const token = localStorage.getItem('token');
      if (!token) {
        setError('Token not found in local storage');
        return;
      }

      try {
        const response = await axios.post(API_ROUTES.fetchUserApps, { token });
        setApps(response.data.apps);
      } catch (error) {
        setError(error.response?.data?.error || 'Error fetching apps');
      }
    };

    fetchApps();
  }, []);

  const onElementsRemove = (elementsToRemove) => setElements((els) => removeElements(elementsToRemove, els));
  const onConnect = (params) => setElements((els) => addEdge(params, els));

  const addNode = () => {
    const newNode = {
      id: (elements.length + 1).toString(),
      data: { label: nodeName },
      position: nodePosition,
    };
    setElements((els) => els.concat(newNode));
  };

  return (
    <Fragment>
      <div className="div_main_dashboard">
        <div className="dashboard_header_container">
          <header className="dashboard_header">
            <div className="header_left">
              <img src={menuIcon} alt="Menu" className="menu-icon" onClick={toggleMenu} />
              <h1>Dashboard</h1>
            </div>
            <div className="header_search">
              <input type="text" placeholder="Search..." className="search_input" />
            </div>
            <div className="header_buttons">
              <button className="header_button">
                <img src={settingsIcon} alt="Settings" />
              </button>
              <button className="header_button">
                <img src={notiIcon} alt="Notifications" />
              </button>
            </div>
          </header>
        </div>
        <Navbar isMenuOpen={isMenuOpen} toggleMenu={toggleMenu} />
        <div className="chat-flow-builder">
          <h2>Build Chat Flow</h2>
          {error && <p className="error-msg">{error}</p>}
          <div className="controls">
            <input
              type="text"
              placeholder="Node Name"
              value={nodeName}
              onChange={(e) => setNodeName(e.target.value)}
            />
            <button onClick={addNode}>Add Node</button>
          </div>
          <div className="reactflow-wrapper">
            <ReactFlowProvider>
              <ReactFlow
                elements={elements}
                onElementsRemove={onElementsRemove}
                onConnect={onConnect}
                deleteKeyCode={46} /* 'delete'-key */
              >
                <Background />
                <Controls />
                <MiniMap />
              </ReactFlow>
            </ReactFlowProvider>
          </div>
        </div>
      </div>
    </Fragment>
  );
};

export default BuildChatFlow;
